	add("viceroy", "{\"term\":\"viceroy\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"Middle french (ca. 1400-1600) \u0027vice-roy\u0027 from \u0027vice-\u0027 + \u0027roy\u0027 (king)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who governs a country, province, or colony as the representative of a monarch\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"When Ireland was a kingdom and when it was part of the United Kingdom of Great Britain and Ireland, the island was governed by a \u0027\u0027\u0027Viceroy\u0027\u0027\u0027 representing the English King/Queen\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An orange and black North American butterfly (), so named because it is similar to, but smaller than, the monarch butterfly\", \"priority\":3}]}, \"synonyms\":{}}");

	add("vicesimation", "{\"term\":\"vicesimation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Probably formed by the {{l|en|suffixation}} of the Latin \u0027vīcēsimus\u0027 (twentieth) with the English \u0027-ation\u0027 on the pattern of \u0027decimation\u0027 but compare the Latin \u0027vīcēsimātiō\u0027 (a killing of every twentieth man) the spelling \u0027vigesimation\u0027 is an alteration of \u0027\u0027 () under the influence of \u0027vigesimal\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The of one- of something; , the or putting to of every twentieth person, by\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1834\u0027\u0027, Samuel Hibbert et alii, \u0027History of the Foundations in Manchester of Chirst’s College, Chetham’s Hospital, and the Free Grammar School\u0027, volume 2, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003du-EHAAAAQAAJ\u0026amp;pg\u003dPA124\u0026amp;dq\u003d%2Bvicesimation\u0026amp;hl\u003den\u0026amp;ei\u003dp7ImTtf_MMuaOpqsub0K\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;ved\u003d0CCwQ6AEwA\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%2Bvicesimation\u0026amp;f\u003dfalse page 124]\u0026lt;/span\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The common prisoners…were ordered to cast lots for every twentieth man to be tried, as a sort of \u0027\u0027vicesimation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1901\u0027\u0027, Joseph Fitzgerald, \u0027Word and Phrase: True and False Use in English\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003d4YwiAAAAMAAJ\u0026amp;q\u003d%2Bvicesimation\u0026amp;dq\u003d%2Bvicesimation\u0026amp;hl\u003den\u0026amp;ei\u003dp7ImTtf_MMuaOpqsub0K\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d2\u0026amp;ved\u003d0CDMQ6AEwAQ page 273]\u0026lt;/span\u0026gt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"We must change the numerator of our fraction.…If one must have the precise fractional term in “ation,” and the loss is one in five, let him coin the word quintation…if one in twenty, \u0027\u0027vicesimation\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1961\u0027\u0027, Victor M Yeates, \u0027Winged Victory\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dq89LAAAAMAAJ\u0026amp;q\u003d%2Bvigesimation\u0026amp;dq\u003d%2Bvigesimation\u0026amp;hl\u003den\u0026amp;ei\u003dobcmTo_FLoS38QOX85DsCg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d2\u0026amp;ved\u003d0CC4Q6AEwATgU page 99]\u0026lt;/span\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"‘This seems to be a wonderful squadron. Fancy getting twenty Huns in one day! And for only one casualty.’\u0026lt;br/\u0026gt;‘If you work out what one casualty a day mounts up to, you will notice that we shall all be casualties within a month. It’s daily \u0027\u0027vigesimation\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1964\u0027\u0027, Kenneth Burke [aut.] and Stanley Edgar Hyman [ed.], \u0027Perspectives by Incongruity\u0027, volume 2, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dmU1aAAAAMAAJ\u0026amp;q\u003d%2Bvigesimation\u0026amp;dq\u003d%2Bvigesimation\u0026amp;hl\u003den\u0026amp;ei\u003dobcmTo_FLoS38QOX85DsCg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d5\u0026amp;ved\u003d0CDwQ6AEwBDgU page 58]\u0026lt;/span\u0026gt\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The practice…of putting to death every twentieth man. Am I…a victim of \u0027\u0027vigesimation\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, David Grambs, \u0027Just Ask Mr. Wordwizard\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dd1oNAQAAMAAJ\u0026amp;q\u003d%2Bvigesimation\u0026amp;dq\u003d%2Bvigesimation\u0026amp;hl\u003den\u0026amp;ei\u003dobcmTo_FLoS38QOX85DsCg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d8\u0026amp;ved\u003d0CEoQ6AEwBzgU page 123]\u0026lt;/span\u0026gt\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"To decimate, originally, was a military punishment, determined by lot, whereby every tenth man was executed. A little luckier for the troops was \u0027\u0027\u0027vigesimation\u0027\u0027\u0027: every twentieth man was killed\", \"priority\":12}]}, \"synonyms\":{}}");

	add("vicinage", "{\"term\":\"vicinage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027visnage\u0027 respelled to more closer match its Latin source \u0027vīcīnus\u0027 (neighbor)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A surrounding district; a neighbourhood\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The people of a neighbourhood\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The state of living near something; proximity, closeness\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The area where a crime was committed, a trial is being held, or the community from which jurors are drawn\", \"priority\":4}]}, \"synonyms\":{}}");

