	add("vicinity", "{\"term\":\"vicinity\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027vicinitas\u0027 (neighborhood) \u0026gt; \u0027vicinus\u0027 (neighbor) \u0026gt; \u0027vicus\u0027 (village)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Proximity, or the state of being near\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d8|passage\u003dThe humor of my proposition appealed more strongly to Miss Trevor than I had looked for, and from that time forward she became her old self again;. Our table in the dining-room became again the abode of scintillating wit and caustic repartee, Farrar bracing up to his old standard, and the demand for seats in the \u0027\u0027vicinity\u0027\u0027 rose to an animated competition\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Neighbourhood, or the nearby region\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Approximate size or amount\", \"priority\":4}]}, \"synonyms\":{}}");

