	add("vicissitude", "{\"term\":\"vicissitude\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"French\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027vicissitude\u0027 from Latin \u0027lang\u003dla|vicissitudo\u0027 () from \u0027lang\u003dla|vicissim\u0027 () from \u0027lang\u003dla|vicis\u0027 () whence Spanish \u0027lang\u003des\u0027 and French \u0027lang\u003dfr|fois\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Regular change or succession from one thing to another, or one part of a cycle to the next; alternation; mutual succession; interchange\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A change, especially in one\u0027s life or fortunes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1667\u0027\u0027, w:John John Milton, \u0027Paradise Lost\u0027, vii, 351\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And God made.. the Stars, and set them in the firmament of Heaven to illuminate the Earth, and rule the day in their \u0027\u0027vicissitude\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0026quot;US redeployments afoot in Asia\u0026quot;, \u0027Christian Science Monitor\u0027, Nov. 18, Pg. 6\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027vicissitudes\u0027\u0027 of war in Iraq cast a dreary backdrop for Donald Rumsfeld\u0027s first visit to Asian military allies since he became US Defense Secretary in 2001\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Senec\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Happy is the man who can endure the highest and lowest fortune. He who has endured such \u0027\u0027vicissitudes\u0027\u0027 with equanimity has deprived misfortune of its power.\u0026lt;!-- modified Webster 1913 defs --\u0026gt\", \"priority\":8}]}, \"synonyms\":{\"list\":[{\"text\":\"ups and downs\", \"synonymQualifier\":\"INFORMAL\"}]}}");

	add("victim", "{\"term\":\"victim\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027victime\u0027 from Latin {{m|la|victima||sacrificial animal}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A living creature which is slain and offered as human or animal sacrifice, usually in a religious rite; by extension, the transfigurated body and blood of Christ in the Eucharist\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Anyone who is harmed by another\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/business/21579011-president-proposes-new-round-intellectual-property-reform-obama-goes-troll-hunting Obama goes passage\u003dAccording to this saga of intellectual-property misanthropy, these creatures [patent trolls] roam the business world, buying up patents and then using them to demand extravagant payouts from companies they accuse of infringing them. Often, their \u0027\u0027victims\u0027\u0027 pay up rather than face the costs of a legal battle\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An aggrieved or disadvantaged party in a crime (e.g. swindle\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person who suffers any other injury, loss, or damage as a result of a voluntary undertaking\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An unfortunate person who suffers from a disaster or other adverse circumstance\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"the speed-mad fugitives from the furies of ennui, the neurotic \u0027\u0027victims\u0027\u0027 of mental cirrhosis, […] !”\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/asia/21580209-natural-disaster-aggravated-poor-response-high-and-wet High and passage\u003dFloods in northern India, mostly in the small state of Uttarakhand, have wrought disaster on an enormous scale.Rock-filled torrents smashed vehicles and homes, burying \u0027\u0027victims\u0027\u0027 under rubble and sludge\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A character who is conquered or manipulated by a villain\", \"priority\":9}]}, \"synonyms\":{}}");

	add("victor", "{\"term\":\"victor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Borrowed from Latin \u0027lang\u003dla|victor\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The winner in a fight or contest\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The letter \u0027V\u0027 in the ICAO spelling alphabet\", \"priority\":2}]}, \"synonyms\":{}}");

	add("victoria", "{\"term\":\"victoria\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027victoria\u0027 from \u0027victoria\u0027 (victory) Can also be interpreted as a feminine form of Victor.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Roman goddess of victory; equivalent to the Greek goddess Nike\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027 Dan Simmons: \u0027Song of Kali\u0027: ISBN 031286583X pages 4, 17\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When I had first told him the name we\u0027d chosen for our daughter, Abe had suggested that it was a pretty damn waspy title for the offspring of an Indian princess and a Chicago pollock\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I never would have chosen the name \u0026quot;\u0027\u0027Victoria\u0027\u0027\u0026quot; but was secretly delighted by it. Amrita first suggested it one hot day in July and we treated it as a joke. It seemed that one of her earliest memories was of arriving by train at \u0027\u0027Victoria\u0027\u0027 Station in Bombay. That huge edifice - one of the remnants of the British Raj, which evidently still defines India - had always filled Amrita with a sense of awe. Since that time, the name \u0027\u0027Victoria\u0027\u0027 had evoked an echo of beauty, elegance and mystery in her\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The queen of the United Kingdom from 1837 to 1901\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1838\u0027\u0027 , \u0027Court and Cabinet Gossip of a New Reign\u0027, April 1838, pages 512-513\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Alexander of Russia, the patron saint of the Cobourgs, was dead, so Alexandrina of England, named in honour of him, gave way to \u0027\u0027Victoria\u0027\u0027 the tutelary deity of his (when living) subservient Cobourgs. Both names are alike foreign and unharmonious to British ears,* although of the two, Alexandrina perhaps the most euphonious. Let us hope, and we have reason to hope, that the Queen will nationalize that of \u0027\u0027Victoria\u0027\u0027, and make it the theme of song and history with that of Elizabeth\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"lt;nowiki\u0026gt;*\u0026lt;/nowiki\u0026gt;George IV., who, whatever his faults, had a true British spirit and sentiments, declared both to be anti-British, and expressed himself in no measured terms at the time about giving the royal infant such unEnglish names\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"One of the six states of Australia, situated in the south-eastern part of the continent, with its capital at Melbourne\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The British colony in what is now the Australian state of Victoria\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The capital of Seychelles\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Provincial capital of British Columbia (Canada\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A rural municipality in Manitob\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Main town of the federal territory of Labuan (Malaysia\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Lake Victoria, the largest lake in Africa\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The City of Victoria, a settlement in Hong Kong often referred to as its capita\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A town in Grenad\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A city in Texa\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Short for , a main belt asteroid\", \"priority\":19}]}, \"synonyms\":{}}");

	add("victoria", "{\"term\":\"victoria\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Named after {{w|Queen Victoria}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A kind of low four-wheeled pleasure carriage, with a calash top, designed for two persons and the driver who occupies a high seat in front\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It was flood-tide along Fifth Avenue; motor, brougham, and \u0027\u0027victoria\u0027\u0027 swept by on the glittering current; pretty women glanced out from limousine and tonneau; young men of his own type, silk-hatted, frock-coated, the crooks of their walking sticks tucked up under their left arms, passed on the Park side\", \"priority\":2}]}, \"synonyms\":{}}");

