	add("victory", "{\"term\":\"victory\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027victory\u0027 from Old french (842-ca. 1400) {{m|fro|victorie}}, from Latin {{m|la|victōria}}, from {{m|la|victor||victor}}. Displaced native Middle English \u0027siȝe\u0027 (from Old English {{m|ang|siġe||victory}}), Old English \u0027sigor\u0027 (victory, triumph)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An instance of having won a competition or battle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A winged figure representing victory, common in Roman official iconography. See Wikipedia:Winged victory\", \"priority\":2}]}, \"synonyms\":{}}");

